pragma solidity ^0.5.8;
pragma experimental ABIEncoderV2;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';
import './DetherToken.sol';
import './bytesUtils.sol';
import './interfaces/IERC223ReceivingContract.sol';

contract TokenRegistry is Ownable, IERC223ReceivingContract, bytesUtils {

  uint public stakeRequired; // staked amount needed to be listed
  DetherToken public dth;


  struct TokenOwner {
    uint stakeAmount;
    address walletAddress;
    uint index;
    uint indexOwnership;
  }

  struct TokenList {
    address tokenAddress;
    string urlInfo;
  }

  TokenList[] public tokenList;
  mapping(address => TokenOwner) public tokenOwner;
  mapping(address => address[]) public ownerships;

  constructor(address _dth, uint _stakeRequired) public {
    stakeRequired = _stakeRequired;
    dth = DetherToken(_dth);
  }

  function updateStakeRequired(uint newStake) onlyOwner public {
    stakeRequired = newStake;
  }

  function getTokenList()
    public
    view
    returns ( TokenList[] memory)
    {
      return tokenList;
    }

  function getTokenOwner(address tokenAddress)
    public
    view
    returns (TokenOwner memory)
    {
      return tokenOwner[tokenAddress];
    }

  function getOwnerships(address owner) public view
    returns (address[] memory)
    {
      return ownerships[owner];
    }
  // TO DO CHECK ERC20/ERC23
  function tokenFallback(address _from, uint _value, bytes memory _data) public {     // gasUsed = 278291
    // require than the token fallback is triggered from the dth token contract
    require(msg.sender == address(dth),'token should come from dth contract');
    require(_value >= stakeRequired,'token send should be superior to the stake required');
    //TODO: require mapping non initialized with this value

    address _tokenAddress = toAddress(_data, 0);
    require(tokenOwner[_tokenAddress].walletAddress == address(0x0), 'token is already on the list');
    bytes memory _urlInfo = slice(_data, 20, _data.length - 20);
    string memory _url = string(_urlInfo);
    uint _index = tokenList.push(TokenList({
      tokenAddress: _tokenAddress,
      urlInfo: _url
    }));

    // listing ownership
    uint _indexOwnership = ownerships[_from].push(_tokenAddress);

    tokenOwner[_tokenAddress] = TokenOwner({
      stakeAmount: _value,
      walletAddress: _from,
      index: _index - 1,
      indexOwnership: _indexOwnership - 1
    });

  }

  function delist(address tokenAddress) public {
    require(msg.sender == tokenOwner[tokenAddress].walletAddress, 'only owner could delist token');

    uint indexToRemove = tokenOwner[tokenAddress].index;
    uint indexToRemoveOwnership = tokenOwner[tokenAddress].indexOwnership;
    uint stakeToGiveback = tokenOwner[tokenAddress].stakeAmount;

    ownerships[msg.sender][indexToRemoveOwnership] = ownerships[msg.sender][ownerships[msg.sender].length - 1];  // remove from address ownership

    // unlist
    tokenList[indexToRemove] = tokenList[tokenList.length - 1];
    tokenOwner[tokenList[indexToRemove].tokenAddress].index = indexToRemove;

    tokenOwner[ownerships[msg.sender][indexToRemoveOwnership]].indexOwnership = indexToRemoveOwnership;   // remove from address ownership

    tokenList.length--;
    ownerships[msg.sender].length--;     // remove from address ownership




    // refund token
    delete tokenOwner[tokenAddress];
    dth.transfer(msg.sender, stakeToGiveback);

    // uint index_to_remove = tokensAndStake[id].index;
    // uint stake_to_giveback = tokensAndStake[id].stakeAmount;

    // tokensAndStake[id].tokenAuthorized = false;
    // bytes32 id_to_move = keccak256(tokenList[tokenList.length - 1]);
    // tokensAndStake[id_to_move].index = index_to_remove;
    // tokenList[index_to_remove] = tokenList[tokenList.length - 1];
    // tokenList.length--;
    // dth.transfer(msg.sender, stake_to_giveback);
}

}
